import React from 'react'
import { useContext } from 'react'
import './SixteenDays.css'
import Context from '../../../../helper/Context'
import DaytimeTemperature from '../../../../components/DaytimeTemperature'


export default function SixteenDays() {

  const twelveDaysData = useContext(Context)

  let arrSixteen = []

  if(twelveDaysData.weatherSixteenDays){
    arrSixteen = twelveDaysData.weatherSixteenDays.slice(0, 12)
  }

  return (
    <div className='sixteen-days'>
      {arrSixteen.map(item => <DaytimeTemperature date={item.valid_date} image={item.weather.icon} max={item.max_temp} min={item.min_temp} description={item.weather.description} />)}
    </div>
  )
}
